import React from 'react';
import './App.css';
import { Link, NavLink } from 'react-router-dom';

function NavBar() {
    const navStyle = {
        color: 'white'
    };

    return (
        <div className="nav-bar">
            <Nav>
                <NavLink to="/">
                    Home
                </NavLink>
                <NavLink to="/vocab">
                    Vocabulary
                </NavLink>
                <NavLink to="/">
                    COMING SOON
                </NavLink>
                <NavLink to="/">
                    COMING SOON
                </NavLink>
            </Nav>
        </div>
    );
}
export default NavBar;
